import "./tip.css"; 
import React from 'react';

const Tips = (props) => {
    return (
        <div id="tip">
            {props.tips && props.tips.map((tip, index) => (
                <div key={index} id="tip-arrow">
                    <img src={tip.image} alt={`tip ${index}`} />
                    <p>{tip.text}</p>
                </div>
            ))}
        </div>
    )
}

export default Tips;
